import React, { useState, useCallback } from 'react';
import { Card, Form, Button, Alert, ProgressBar, Row, Col } from 'react-bootstrap';
import studentService from '../../services/studentService';

const ExcelUpload = ({ onExcelUploaded }) => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [uploading, setUploading] = useState(false);
  const [uploadResult, setUploadResult] = useState(null);

  const handleFileSelect = useCallback((event) => {
    const file = event.target.files[0];
    if (
      file &&
      (file.type === 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' ||
        file.type === 'application/vnd.ms-excel')
    ) {
      setSelectedFile(file);
      setUploadResult(null);
    } else {
      setSelectedFile(null);
      alert('Please select a valid Excel file (.xlsx or .xls)');
    }
  }, []);

  const handleUpload = useCallback(async () => {
    if (!selectedFile) {
      alert('Please select a file first');
      return;
    }
    setUploading(true);
    try {
      const result = await studentService.uploadExcel(selectedFile);
      setUploadResult(result.summary);
      onExcelUploaded(result.summary);
      setSelectedFile(null);
      document.getElementById('excel-upload').value = '';
    } catch (error) {
      console.error('Upload error:', error);
      alert('Failed to upload Excel file');
    } finally {
      setUploading(false);
    }
  }, [selectedFile, onExcelUploaded]);

  const downloadSample = useCallback(async () => {
    try {
      const blob = await studentService.downloadSampleExcel();
      const url = window.URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = url;
      link.download = 'student-template.xlsx';
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      window.URL.revokeObjectURL(url);
    } catch (error) {
      console.error('Download error:', error);
      alert('Failed to download sample template');
    }
  }, []);

  return (
    <Card className="shadow-lg rounded-3">
      <Card.Header className="d-flex align-items-center bg-primary text-white py-3 px-4 rounded-top">
        <i className="bi bi-file-earmark-excel me-2 fs-5"></i>
        <h5 className="mb-0 fw-semibold">Bulk Upload Students</h5>
      </Card.Header>

      <Card.Body className="p-4">
        <Form noValidate>
          <Form.Group className="mb-4">
            <Form.Label className="fw-semibold">Select Excel File</Form.Label>
            <Form.Control
              id="excel-upload"
              type="file"
              accept=".xlsx,.xls"
              onChange={handleFileSelect}
              disabled={uploading}
              className="p-2"
            />
            <Form.Text className="text-muted">
              Supported formats: .xlsx, .xls
            </Form.Text>
          </Form.Group>

          <Row className="g-3 mb-3">
            <Col xs={12} sm={6}>
              <Button
                variant="primary"
                className="w-100 d-flex align-items-center justify-content-center gap-2"
                onClick={handleUpload}
                disabled={!selectedFile || uploading}
              >
                {uploading ? (
                  <>
                    <span className="spinner-border spinner-border-sm" />
                    Uploading...
                  </>
                ) : (
                  <>
                    <i className="bi bi-file-earmark-excel"></i>
                    Upload Excel
                  </>
                )}
              </Button>
            </Col>
            <Col xs={12} sm={6}>
              <Button
                variant="outline-secondary"
                className="w-100 d-flex align-items-center justify-content-center gap-2"
                onClick={downloadSample}
                disabled={uploading}
              >
                <i className="bi bi-download"></i>
                Download Sample Template
              </Button>
            </Col>
          </Row>
        </Form>

        {uploading && (
          <div className="my-3">
            <ProgressBar animated now={100} variant="primary" />
          </div>
        )}

        {uploadResult && (
          <Alert
            variant={uploadResult.failed > 0 ? 'warning' : 'success'}
            className="mt-3"
            dismissible
            onClose={() => setUploadResult(null)}
          >
            <Alert.Heading>Upload Results</Alert.Heading>
            <p className="mb-2">
              Total Records: {uploadResult.total}
              <br />
              Successfully Added: {uploadResult.successful}
              <br />
              Failed: {uploadResult.failed}
            </p>
            {uploadResult.errors?.length > 0 && (
              <ul className="list-group small mt-2" style={{ maxHeight: '150px', overflowY: 'auto' }}>
                {uploadResult.errors.slice(0, 5).map((error, index) => (
                  <li key={index} className="list-group-item py-1">
                    Row {error.row}: {error.error}
                  </li>
                ))}
                {uploadResult.errors.length > 5 && (
                  <li className="list-group-item py-1 text-muted">
                    ... and {uploadResult.errors.length - 5} more errors
                  </li>
                )}
              </ul>
            )}
          </Alert>
        )}
      </Card.Body>
    </Card>
  );
};

export default ExcelUpload;
